import axios from "axios";
import { useState } from "react";

function Phones(){
    const [phones, setPhones] = useState()
    axios.get("http://localhost:5005/api/phones")
    .then((response)=>{
       setPhones(response.data)
    })
    .catch((error) => {
        console.log("error: ", error);
    })
    return(
        <>
            <h1>Phones</h1>
        </>
    )
}
export default Phones;
